import React, { useState, useEffect } from "react";

function About() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const apiUrl = 'http://openlibrary.org/api/volumes/brief/isbn/9780525440987.json';

    fetch(apiUrl)
      .then(response => response.json())
      .then(data => setData(data.items))
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <h1>API Data Display</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>{item.volumeInfo.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default About;
